  public void ImportSHPTest() 
{ 
          // 1.Create DatasourceConnectionInfo object
          DatasourceConnectionInfo info = new DatasourceConnectionInfo(); 
          info.EngineType=EngineType.UDB; 
       info.Server = @"E:\conversion\import\testimport.udb"; 
       info.Alias = "testimport_udb"; 
       info.Password=""; 

          //2.Create importSettingSHP object, set the import path and the TargetDatasourceConnectionInfo 
          String path = @"E:\conversion\test.shp"; 
          ImportSettingSHP importSettingSHP = new ImportSettingSHP(); 
          importSettingSHP.TargetDatasourceConnectionInfo = info; 
          importSettingSHP.SourceFilePath = path; 
          ImportDataInfos importDataInfos2 = importSettingSHP.GetTargetDataInfos(""); 
          String[] names = PathManager.SetTagetDatasetName(importDataInfos2, "shp1"); 
          importSettingSHP.SetTargetDataInfos(importDataInfos2); 

          //3.Create DataImport object and set the importSettings object
          DataImport dataImport = new DataImport(); 
          ImportSettings importSettings = dataImport.ImportSettings; 
          importSettings.Add(importSettingSHP); 
          dataImport.ImportSettings = importSettings; 

          PathManager.deleteDatasets(info, names); 
          //Import
          ImportResult result = dataImport.Run(); 
          Assert.AreEqual(0, result.FailedSettings.Length); 
          //Get the dataset name when imported successfully
          //Note that pass the imported succeedSetting, it can be got by ImportResult 
          String[] SucceedName = result.GetSucceedDatasetNames(result.SucceedSettings[0]); 
          Console.WriteLine(SucceedName); 
      }

